    local function setStatus(state)
        if spinConnection then
            spinConnection:Disconnect()
            spinConnection = nil
            statusIcon.Rotation = 0
        end
        
        if dotsThread then
            task.cancel(dotsThread)
            dotsThread = nil
        end
        
        local color = Config.colors.statusIdle
        local icon = Icons.lock
        local text = "未检测到卡密"
        
        if state == "verifying" then
            color = Config.colors.accent
            icon = Icons.loading
            text = "正在验证授权"
            
            spinConnection = RunService.Heartbeat:Connect(function(dt)
                if statusIcon and statusIcon.Parent then
                    statusIcon.Rotation = (statusIcon.Rotation + dt * 360) % 360
                else
                    if spinConnection then spinConnection:Disconnect() end
                end
            end)
            
            local dots = {".", "..", "...", ""}
            local i = 1
            dotsThread = task.spawn(function()
                while statusLabel and statusLabel.Parent do
                    if not statusLabel.Text:find("正在验证", 1, true) then break end
                    statusLabel.Text = text .. dots[i]
                    i = (i % #dots) + 1
                    task.wait(0.4)
                end
            end)
            
        elseif state == "success" then
            color = Config.colors.success
            icon = Icons.check
            text = "访问已授权"
            
        elseif state == "error" then
            color = Config.colors.error
            icon = Icons.alert
            text = "无效授权"
        end
        
        TweenService:Create(statusLabel, TweenInfo.new(0.3), {TextColor3 = color}):Play()
        TweenService:Create(statusIcon, TweenInfo.new(0.3), {ImageColor3 = color}):Play()
        statusLabel.Text = text
        statusIcon.Image = icon
    end
    
    local function handleRedeem()
        local key = textBox.Text:gsub("%s+", "")
        
        if key == "" then
            Notify("错误", "请输入你的授权密钥", 3, "warning")
            return
        end
        
        setStatus("verifying")
        redeemBtn.Active = false
        
        task.wait(0.3)
        
        local success, result = pcall(function()
            return Junkie.check_key(key)
        end)
        
        redeemBtn.Active = true
        
        if not success then
            setStatus("error")
            Notify("错误", "连接服务器失败", 3, "error")
            return
        end
        
        if not result then
            setStatus("error")
            Notify("错误", "服务器无响应", 3, "error")
            return
        end
        
        if result.valid then
            saveKey(key)
            getgenv().SCRIPT_KEY = key
            setStatus("success")
            Notify("成功", "授权验证成功!", 2, "success")
            
            task.wait(1)
            
            TweenService:Create(mainFrame, TweenInfo.new(0.4, Enum.EasingStyle.Quart), {
                Position = UDim2.new(0.5, 0, -0.5, 0),
                BackgroundTransparency = 1
            }):Play()
            
            task.wait(0.4)
            screenGui:Destroy()
        else
            setStatus("error")
            
            local errorMessages = {
                KEY_INVALID = "系统中未找到此密钥",
                KEY_EXPIRED = "授权已过期",
                HWID_BANNED = "硬件已被封禁",
                KEY_INVALIDATED = "授权已被撤销",
                ALREADY_USED = "一次性密钥已使用",
                HWID_MISMATCH = "硬件ID限制已达上限",
                SERVICE_NOT_FOUND = "服务未找到",
                SERVICE_MISMATCH = "服务不匹配",
                PREMIUM_REQUIRED = "需要高级权限",
                ERROR = "网络错误"
            }
            
            local errCode = result.error or "Unknown"
            local errMsg = errorMessages[errCode] or result.message or errCode
            
            Notify("无效", errMsg, 4, "error")
            
            if errCode == "HWID_BANNED" then
                task.wait(2)
                game.Players.LocalPlayer:Kick("硬件已被封禁")
            end
        end
    end
    
    local function handleAcquire()
        Notify("已复制", "授权链接已复制到剪贴板!", 3, "copy")
        pcall(function()
            setclipboard(Config.key_link)
        end)
    end
    
    local function handleDiscord()
        Notify("Discord", "邀请链接已复制!", 2, "discord")
        pcall(function()
            setclipboard(Config.discord_link)
        end)
    end
    
    redeemBtn.MouseButton1Click:Connect(handleRedeem)
    acquireBtn.MouseButton1Click:Connect(handleAcquire)
    discordBtn.MouseButton1Click:Connect(handleDiscord)
    
    textBox.FocusLost:Connect(function(enterPressed)
        if enterPressed then
            handleRedeem()
        end
    end)
    
    local dragging = false
    local dragStart
    local startPos
    
    header.InputBegan:Connect(function(input)
        if input.UserInputType == Enum.UserInputType.MouseButton1 or input.UserInputType == Enum.UserInputType.Touch then
            dragging = true
            dragStart = input.Position
            startPos = mainFrame.Position
            
            input.Changed:Connect(function()
                if input.UserInputState == Enum.UserInputState.End then
                    dragging = false
                end
            end)
        end
    end)
    
    UserInputService.InputChanged:Connect(function(input)
        if dragging and (input.UserInputType == Enum.UserInputType.MouseMovement or input.UserInputType == Enum.UserInputType.Touch) then
            local delta = input.Position - dragStart
            mainFrame.Position = UDim2.new(
                startPos.X.Scale,
                startPos.X.Offset + delta.X,
                startPos.Y.Scale,
                startPos.Y.Offset + delta.Y
            )
        end
    end)
    
    mainFrame.Position = UDim2.new(0.5, 0, 1.5, 0)
    TweenService:Create(mainFrame, TweenInfo.new(0.5, Enum.EasingStyle.Quart), {
        Position = UDim2.new(0.5, 0, 0.5, 0)
    }):Play()
    
    return screenGui
end

local function getKeyToValidate()
    if getgenv().SCRIPT_KEY and getgenv().SCRIPT_KEY ~= "" then
        return getgenv().SCRIPT_KEY, "getgenv"
    end
    
    local savedKey = loadKey()
    if savedKey then
        return savedKey, "saved"
    end
    
    return nil, nil
end

local keyToCheck, keySource = getKeyToValidate()

if keyToCheck then
    Notify("检查中", "正在验证保存的授权...", 2, "shield")
    task.wait(0.3)
    
    local success, result = pcall(function()
        return Junkie.check_key(keyToCheck)
    end)
    
    if success and result and result.valid then
        if result.message == "KEYLESS" then
            getgenv().SCRIPT_KEY = "KEYLESS"
            Notify("欢迎", "无密钥访问已授权!", 2, "success")
        else
            if keySource == "getgenv" then
                saveKey(keyToCheck)
            end
            getgenv().SCRIPT_KEY = keyToCheck
            Notify("欢迎回来", "授权验证成功!", 2, "success")
        end
    else
        if keySource == "saved" then
            clearKey()
            Notify("已过期", "保存的授权已失效", 3, "warning")
        end
        task.wait(1)
        Build()
    end
else
    Build()
end

while not getgenv().SCRIPT_KEY do
    task.wait(0.1)
end

